import styled from "styled-components";

const MessageItem = styled.div`
  background: #1e1e1e;
  padding: 10px;
  margin-bottom: 5px;
  border-radius: 8px;
`;

function Message({ content }) {
  return (
    <MessageItem>
      {content}
    </MessageItem>
  );
}

export default Message;
